import { Suspense } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";

import Loans from '../pages/Loan';


export default function Content() {
    return (
        <>
            <BrowserRouter>
                <Suspense fallback={<div>Loading...</div>}>
                    <Switch>
                        <Route path="/loans">
                            <Loans />
                        </Route>
                    </Switch>
                </Suspense>
            </BrowserRouter>
        </>
    )
}
